import React from "react";

export default function Modal(props) {
  return (
    <form>
      <div className="mb-3">
        <img src={props.img} height="200px" width="100%" style={{borderRadius:"8px",marginBottom:"20px"}} className="card-img-top" alt="..." />
        <div style={{fontSize:"20px",fontWeight:"500"}}>{props.name}</div>
        <div><p style={{fontSize:"15px",fontWeight:"500"}}>Discreption: </p>{props.title}</div>
        <div><p style={{fontSize:"15px",fontWeight:"500"}}>Seller-Name: </p>{props.seller}</div>
        <div><p style={{fontSize:"15px",fontWeight:"500"}}>Price: </p>{props.price}</div>
      </div>
    </form>
  );
}
